import './Competencias.css';

export default function Competencias(){

    let btn = "¡Sorpréndete!";

    return(
        <div className="competenciasContenedor">
            <div>
                <iframe src='http://www.google.com' title='Conscious Software'></iframe>
                <iframe></iframe>
                <iframe></iframe>
            </div>
            <div className='competenciasDescription'>
                <h1>¿Considera la proactividad una cualidad importante?</h1>
                <h2>¡Yo sí! Aparte de ser proactiva, también soy autodidacta, curiosa, perseverante, adaptable y apasionada!</h2>
                <button id='btnCompetencias'>{btn}</button>
            </div>
        </div>
    )
}
